import axios from 'axios'
import { BASE_PATH, SIGNAL } from '../paths/index'

export function loadSignals(page,bearer){
  return axios
     .get(BASE_PATH + SIGNAL, {
     headers: { Authorization: `Bearer ${bearer}` }
    })
     .then(response => {
       return response
        })
      .catch(err => {
           console.log(err)
      })
}
